import React, { Component } from 'react';

class KnnScreen extends Component {
  render() {
    return (
      <div style={styles.main}>
        <h2>K-Nearest-Neighbor (KNN)</h2>
        <hr />
        <p>The KNN algorithm.</p>
      </div>
    );
  }
}

const styles = {
  main: {
    width: 800,
    display: "inline-block",
    marginTop: 100,
    padding: 40,
    color: "rgb(0, 61, 112)",
    backgroundColor: "rgb(193, 227, 255)",
    borderRadius: 7
  }
};

export default KnnScreen;
